@cfpr_kinofit Marco Ferrari, Trainer del CrossFit Seminar Staff e owner di CrossFit Parma @crossfitparma dal 2012. In questo video sta allenamento suo papà Daniele, che ha due protesi alle ginocchia. Si avete visto bene, sta fecondo degli Squat. Perché? Perché i movimenti funzionali,  come lo squat, lo stacco da terra e le spinte sopra  la testa, sono movimenti non solo naturali ma anche essenziali. Essenziali in che senso? Nel senso che ci permettono di vivere la nostra vita in maniera indipendente, senza assistenza. Significa che quando inciampiamo siamo in grado di rialzarci(burpees), che riusciamo a sederci a tavola e mangiare da soli(squat), che siamo in grado di mettere la spesa nel bagagliaio (deadlift) o di mettere una coperta sullo scaffale (press) . Quando perdiamo la nostra capacità funzionale cadiamo in decrepitudine o decrepitezza, quello stato che non ci permette di vivere indipendentemente. Marco allena il papà Daniele per tenerlo lontano dalla casa di riposo. Bravo Marco e complimenti a Daniele! .
Spiegazione liberamente tradotta dalla guida CrossFit L1 di @crossfittraining .
